description:
A pirate&#x2019;s been executed, and the Baron takes a hostage to ensure you&#x2019;ll help him track down the treasure he left behind. Only it&#x2019;s not the plunder he&#x2019;s looking for&#x2026;

Based on the true story of a famous pirate, Sea of Lies: Mutiny of the Heart Collector&apos;s Edition takes you on a rollicking adventure as you track down a pirate&#x2019;s treasure and find out what really happened between him and the Baroness.

This is a special Collector&apos;s Edition release full of exclusive extras you won&#x2019;t find in the standard version
